import React from 'react';
import './index.css';

const ScriptView = ({ generatedScript, part1, part2, part3, part4 }) => {
  return (
    <div className="script-view-container">
      <h1 className="title">Generated Script</h1>
      <textarea className="generated-script" value={generatedScript} readOnly cols="50" rows="20"/>
      <div className="parts-container">
        <p>{part1}</p>
        <p>{part2}</p>
        <p>{part3}</p>
        <p>{part4}</p>    
      </div>
      <h1 className="title">Generated Images</h1>
      <img src={part1Url} alt="part1" />
      <img src={part2Url} alt="part2" />
      <img src={part3Url} alt="part3" />
      <img src={part4Url} alt="part4" />
    </div>
  );
};



export default ScriptView;
